import React from 'react';

function Header(props){

   const handleLogin = (e) => {
      e.preventDefault()
      props.handleLoginClick();
   }

   const handleSignUp = (e) => {
      e.preventDefault()
      props.handleSignUpLink();
   }

   return <div><nav>
      <ul>
         <li><h1>KeeperApp</h1></li>
         <li><button onClick={handleLogin} className="loginicon">Login</button></li>
         <li><button onClick={handleSignUp} className="loginicon">SignUp</button></li>
      </ul>
   </nav>
   <div id="mybutton">
         <button class="feedback">+</button>
   </div>
   </div>
   
}

export default Header;
